import { Row, Col, Card } from 'antd'
import React from 'react'
import { noteMaker } from '../../assets'

export default function Home() {
  return (
    <div>
      <Row>
        <br/>
        <Col xs={{span: '0'}} md={{span: '24'}} align="left"> 
        <Card
    hoverable
    style={{
      width: 240,
      border: '0px',
      padding: '10px',
      display: 'inline-block'
    }}
    cover={<img alt="example" src={noteMaker} />}
  >
    <Card.Meta title="Notes" description="Lets some of your time and a lot of trees" />
  </Card>

  <Card
    hoverable
    style={{
      width: 240,
      border: '0px',
      padding: '10px',
      display: 'inline-block'

    }}
    cover={<img alt="example" src={noteMaker} />}
  >
    <Card.Meta title="Notes" description="Lets some of your time and a lot of trees" />
  </Card>
        </Col>
      </Row>
      <br/>
      </div>
  )
}
